import React from 'react';
import { Parallax, ParallaxProvider } from 'react-scroll-parallax';
import styled from 'styled-components';
import HeaderTitle from '../HeaderTiltle/HeaderTitle';
import Parallaxie from '../Parallax/Parallax';

function Partner() {
    return(
        <PartnerSection>
            <ParallaxProvider>
                <PartnerContainer className='container'>
                    <Parallaxie src='../../images/h1-parallax-img-3.jpeg'/>

                    <BodyContainer>
                        <HeaderTitle header='Strategic Partners'/>

                        <BrandContainer>
                            <Brand>
                                <Images className='img' src = '../../images/h1-client-img-1.png'/>
                                <ImagesHover className='img-hover' src = '../../images/h1-client-hover-img-1.png'/>
                            </Brand>
                        </BrandContainer>
                    </BodyContainer>    
                </PartnerContainer>
            </ParallaxProvider>
        </PartnerSection>
    );
}

const PartnerSection = styled.section`
    overflow: hidden;
`
const PartnerContainer = styled.div`
    position: relative;
`

const BodyContainer = styled.div``

const BrandContainer = styled.div`
    display: flex;
    flex-direction: row;
    justify-content: space-around;
`

const Brand = styled.div`
    max-width: 25%;
    :hover{
        .img{
            display: none;
        }
        .img-hover{
            display: block;
        }
    }
`

const Images = styled.img`
    display: block;
`

const ImagesHover = styled.img`
    display: none;
`

export default Partner;
